INSERT INTO `post` (`id`, `title`, `content`, `avatar`, `avatar_content_type`, `create_date`, `view`, `place_id`) VALUES
(1, '3N2Đ nghỉ dưỡng ở Havana Nha Trang gồm vé xe lửa 5 sao khứ hồi chỉ 2,4 triệu', 'Chỉ với 2,4 triệu là bạn đã có thể tự thưởng cho mình một kỳ nghỉ Nha Trang đẳng cấp 5 sao với xe lửa khứ hồi sang trọng cực chất và 2 đêm nghỉ dưỡng tại khách sạn Havana…', , 'image/jpeg', '2017-03-28 02:47:17', 5, 1);
INSERT INTO `post` (`id`, `title`, `content`, `avatar`, `avatar_content_type`, `create_date`, `view`, `place_id`) VALUES
(2, 'Tour tham quan Nhà Trắng được mở cửa trở lại', 'Sau một thời gian tạm ngừng, nơi ở của gia đình tổng thống Mỹ sẽ mở cửa trở lại các tour dành cho du khách.', , 'image/jpeg', '2017-03-26 03:42:40', 5, 2);
INSERT INTO `post` (`id`, `title`, `content`, `avatar`, `avatar_content_type`, `create_date`, `view`, `place_id`) VALUES
(3, 'Hang Sơn Đoòng, thác Bản Giốc là kỳ quan châu Á', 'Hai thắng cảnh của Việt Nam là hang Sơn Đoòng và thác Bản Giốc có tên trong danh sách 7 kỳ quan thiên nhiên do tạp chí National Geographic bình chọn.', , 'image/jpeg', '2017-03-26 03:43:48', 4, 3);
INSERT INTO `post` (`id`, `title`, `content`, `avatar`, `avatar_content_type`, `create_date`, `view`, `place_id`) VALUES
(4, '4 quán mới này sẽ chứng minh chẳng bao giờ bạn đi hết nổi cafe đẹp ở Bangkok!', 'Không chỉ đáp ứng được nhu cầu về phần nhìn, những quán cafe này còn được nhiều người yêu thích bởi hương vị đặc trưng, thực đơn đa dạng cũng như những món nước, món bánh đặc sắc.', , 'image/jpeg', '2017-03-26 03:44:47', 8, 4);
INSERT INTO `post` (`id`, `title`, `content`, `avatar`, `avatar_content_type`, `create_date`, `view`, `place_id`) VALUES
(5, 'Hang Sơn Đoòng, thác Bản Giốc là kỳ quan châu Á', 'Từ ngày 1/3/2017 khách đến tham quan Thung Lũng Tình Yêu tại Đà Lạt sẽ phải mua vé với giá 100.000 đồng cho người lớn và 50.000 đồng cho trẻ em.', , 'image/jpeg', '2017-03-26 03:45:15', 6, 4);
INSERT INTO `post` (`id`, `title`, `content`, `avatar`, `avatar_content_type`, `create_date`, `view`, `place_id`) VALUES
(6, '3N2Đ nghỉ dưỡng ở Havana Nha Trang gồm vé xe lửa 5 sao khứ hồi chỉ 2,4 triệu', '<div><p style="text-align: left;">Chỉ với 9.990.000 đồng/khách, bạn sẽ cơ có hội khám phá những điểm đến nổi tiếng của Trung Quốc như: Di Hòa Viên, Thiên An Môn, sân vận động tổ chim, Vạn Lý Trường Thành…</p><div style="text-align: left;"><br/></div></div>', , 'image/jpeg', '2017-03-26 03:45:54', 0, 2);
INSERT INTO `post` (`id`, `title`, `content`, `avatar`, `avatar_content_type`, `create_date`, `view`, `place_id`) VALUES
(7, 'Tà Xùa đẹp bình yên trong sắc đào nở muộn', 'Hoa đào bung nở bên những mái nhà trầm mặc là cảnh đẹp yên bình mà các du khách khó lòng bỏ qua khi đến Tà Xùa (Bắc Yên, Sơn La) những ngày xuân.', , 'image/jpeg', '2017-03-26 03:46:16', 9, 2);
