(13, 'Không thể bỏ qua 7 điểm ngắm hoa anh đào tuyệt đẹp ở Tokyo', 'Chỉ với 9.990.000 đồng/khách, bạn sẽ cơ có hội khám phá những điểm đến nổi tiếng của Trung Quốc như: Di Hòa Viên, Thiên An Môn, sân vận động tổ chim, Vạn Lý Trường Thành…', , 'image/jpeg', '2017-03-26 03:46:00', NULL, 1);
